import styled from 'styled-components'
import { colors, fonts } from '../../utils/style/variables'
import HomeMenu from '../../components/HomeMenu'

const Header = styled.h1`
    text-align: center;
    font-family: ${fonts.header};
    font-size: clamp(20px, 12vw, 140px);
    color: ${colors.fourth};
    background-color: rgba(${colors.secondary}.r, ${colors.secondary.g}.r, ${colors.secondary.b}, 0.5);
    margin: 80px auto;
    width: 60vw
`

function Home() {
    return (
        <div>
            <Header>COOK BOOK</Header>
            <HomeMenu />
        </div>
    );
  }

  export default Home;
